import React from 'react';
import { Col, Row, Button } from 'antd';
import Navbar from '../components/Navbar';
import './Boleteria.css';

function Boleteria() {
  const renderButacas = (fila) => {
    return (
      <Row justify="center" gutter={[16, 16]}>
        {['1', '2', '3', '4', '5'].map((num) => (
          <Col key={num}>
            <Button className="butaca">{fila + num}</Button>
          </Col>
        ))}
      </Row>
    );
  };

  return (
    <div className="background">
      <Row>
        <Col xs={24}>
          <Navbar />
        </Col>
      </Row>
      <Row justify="center" align="middle" style={{ minHeight: '80vh' }}>
        <Col xs={24} sm={16} md={12} lg={8}>
          <div className="pantalla">Pantalla</div>
          {renderButacas('A')}
          {renderButacas('B')}
          {renderButacas('C')}
          {renderButacas('D')}
          <Row justify="space-between" style={{ marginTop: '20px' }}>
            <Col>
              <Button className="btn-navegacion">Atr√°s</Button>
            </Col>
            <Col>
              <Button type="primary" className="btn-navegacion">Siguiente</Button>
            </Col>
          </Row>
        </Col>
      </Row>
    </div>
  );
}

export default Boleteria;
